import "./ExpenseItem.css"

function ExpenseItem(){
    return (
        <div>
            <div className="expense-item">12 March 2020</div>
            <div>
                <h2>Car Insurance</h2>
                <div>$200</div>
            </div>
        </div>
    )
}


export default ExpenseItem;
